Poonam Ki Raat | 1965 | Suspense Thriller | 947 MB | DVDRip | Phantom

Prakash Gupta (Manoj Kumar) visits the haveli of his rich class mate Chander away from Mumbai. He falls in love with his sister (Kumud Chuggani). While on the way to the haveli, he hears in a small restaraunt that the haveli is haunted due to murder of a tawaif Rani on full moon. Chander's father Lalaji is on his death bed. Lalaji's sister (Leela Mishra), daughter (Shashikala), elder son Ramesh are waiting for Lalaji's death. Outsiders who can have a stake in the property are also guessing as to who will get what- doctor, Mukta, Mukta's father, Rajendra Nath etc. A full time nurse looks after Lalaji who has been appointed by the doctor. The nurse is murdered on full moon (poonam ki raat). Prakash is on the look out for Rani as he sees her following him in his room, followed by a black cat. Peter (Prem Chopra) also adds suspense.

